import React from 'react'
const onLogIn = () => {
    return(
        <>
            <li class="nav-item"><a class="btn bg-light p-1" style={{fontSize: "14px"}} href="#">Login</a></li>
            <li class="nav-item"><a class="nav-link btn btn-light bg-dark ml-1 p-1" style={{fontSize: "14px"}} href="#">Register</a></li>                
        </>
    );
}

export default onLogIn;
